import React from "react";
import {
    Box,
    Button,
    Divider,
    Paper,
    Stack,
    TextField,
    Typography,
} from "@mui/material";
import { grey } from "@mui/material/colors";
import GenericComboBox from "../reusables/GenericComboBox";
import { Container } from "@mui/system";
import { ArrowBack, Save } from "@mui/icons-material";

function PersonaAE() {
    const paperStyle = {
        sx: {
            width: "100%",
            minWidth: "250px",
            mb: 3,
        },
    };

    const boxStyle = {
        sx: {
            width: "100vw",
            minHeight: "100vh",
            height: "100%",
            backgroundColor: "#dbdbdb",
            m: 0,
            py: 2,
        },
    };

    const textLabel = {
        variant: "body1",
        color: grey[700],
        style: { fontWeight: "600" },
    };

    const stackHeaderStyle = {
        direction: "row",
        justifyContent: "space-between",
        sx: { my: 2 },
    };
    const stackRowStyle = {
        flexDirection: { xs: "column", sm: "row" },
        sx: { mt: 2 },
    };

    const inputsStackStyle = {
        sx: { width: "25%", minWidth: "200px", mr: 2 },
    };

    const backButtonStyle = {
        variant: "contained",
        color: "primary",
        sx: { textTransform: "none" },
    };

    const saveButtonStyle = {
        variant: "contained",
        color: "success",
        sx: { textTransform: "none" },
    };

    return (
        <>
            <Box {...boxStyle}>
                <Container>
                    <Paper {...paperStyle}>
                        <Box sx={{ p: 1 }}>
                            <Typography variant={"h5"}>
                                Datos Generales
                            </Typography>
                            <Divider />
                            <Stack {...stackRowStyle}>
                                <Stack {...inputsStackStyle}>
                                    <Typography {...textLabel}>
                                        Nombre
                                    </Typography>
                                    <TextField
                                        // value={nombre}
                                        onChange={(event) => {
                                            // setNombre(event.target.value);
                                        }}
                                    />
                                </Stack>
                                <Stack {...inputsStackStyle}>
                                    <Typography {...textLabel}>
                                        Apellido
                                    </Typography>
                                    <TextField
                                        // value={nombre}
                                        onChange={(event) => {
                                            // setNombre(event.target.value);
                                        }}
                                    />
                                </Stack>
                                <Stack {...inputsStackStyle}>
                                    <Typography {...textLabel}>
                                        Numero Documento
                                    </Typography>
                                    <TextField
                                        // value={nombre}
                                        onChange={(event) => {
                                            // setNombre(event.target.value);
                                        }}
                                    />
                                </Stack>
                            </Stack>
                            <Stack stackRowStyle>
                                <Stack {...inputsStackStyle}>
                                    <Typography {...textLabel}>
                                        Tipo documento
                                    </Typography>
                                    <GenericComboBox
                                        // label="Tipo de documento"
                                        id="tipoDoc"
                                        // value={tipoDoc}
                                        handleChange={(event) => {
                                            // setTipoDoc(event.target.value);
                                        }}
                                        editable={true}
                                        valueForNone="dfd"
                                        labelForNone="Seleccionar tipo de documento"
                                        values={["DNI", "Pasaporte", "L.E."]}
                                        minWidth={200}
                                    />
                                </Stack>
                            </Stack>
                        </Box>
                    </Paper>
                    <Stack direction={"row"} justifyContent={"space-between"}>
                        <Button {...backButtonStyle}>
                            <ArrowBack />
                            Volver
                        </Button>
                        <Button {...saveButtonStyle}>
                            <Save />
                            Guardar
                        </Button>
                    </Stack>
                </Container>
            </Box>
        </>
    );
}

export default PersonaAE;
